DELETE FROM $$p_bicom.FACT_SUSCRIPCION F WHERE EXISTS(SELECT * FROM $$p_staging.ECDA_AXINF_SUSCRIPCION A WHERE F.ID_FECHA = A.ID_FECHA AND F.ID_LOCALIZACION = A.ID_LOCALIZACION AND F.ID_ARTICULO_COLOR_TALLA = A.ID_ARTICULO_COLOR_TALLA );
Commit;
INSERT --+ APPEND INTO $$p_bicom.FACT_SUSCRIPCION (ID_FECHA , ID_LOCALIZACION , ID_ARTICULO , ID_ARTICULO_COLOR , ID_ARTICULO_COLOR_TALLA , ID_PRODUCTO , PENDIENTES_ENVIAR , ENVIADAS , NOTIFICACIONES_VISTAS , CADUCADAS , FECHA_ALTA , USUARIO_ALTA , CODIGO_TIPO_SUSCRIPCION , ID_CENTRO_COMPRA , ID_CAMPANA , MODELO , CALIDAD , COLOR , TALLA) SELECT ID_FECHA , ID_LOCALIZACION , ID_ARTICULO , ID_ARTICULO_COLOR , ID_ARTICULO_COLOR_TALLA , ID_PRODUCTO , PENDIENTES_ENVIAR , ENVIADAS , NOTIFICACIONES_VISTAS , CADUCADAS , SYSDATE/*TO_DATE('$$p_fechaCarga', 'YYYY-MM-DD HH24:MI')*/ AS FECHA_ALTA , '$$p_usuario' AS USUARIO_ALTA , 0 AS CODIGO_TIPO_SUSCRIPCION , ID_CENTRO_COMPRA , ID_CAMPANA , MODELO , CALIDAD , COLOR , TALLA FROM $$p_staging.ECDA_AXINF_SUSCRIPCION WHERE ID_ARTICULO_COLOR_TALLA>0;

ALTER SESSION ENABLE PARALLEL DML;
DELETE FROM $$p_bicom.FACT_STOCK_ALM_ECOMM F WHERE EXISTS (SELECT 1 FROM (SELECT DISTINCT ID_FECHA FROM $$p_staging.ECDA_AXINF_STOCK_ALM_ECOMM) AUX WHERE AUX.ID_FECHA = F.ID_FECHA
);
commit;
INSERT --+ APPEND INTO $$p_bicom.FACT_STOCK_ALM_ECOMM (ID_FECHA ,ID_LOCALIZACION ,ID_ARTICULO ,ID_ARTICULO_COLOR ,ID_ARTICULO_COLOR_TALLA ,ID_PRODUCTO ,CANTIDAD_TRANSITO ,CANTIDAD_DISPONIBLE ,FECHA_ALTA ,USUARIO_ALTA , ID_CENTRO_COMPRA , ID_CAMPANA , MODELO , CALIDAD , COLOR , TALLA ,CANTIDAD_PENDIENTE) SELECT DISTINCT ID_FECHA ,ID_LOCALIZACION ,ID_ARTICULO ,ID_ARTICULO_COLOR ,ID_ARTICULO_COLOR_TALLA ,ID_PRODUCTO ,CANTIDAD_TRANSITO ,CANTIDAD_DISPONIBLE ,SYSDATE/*TO_DATE('$$p_fechaCarga', 'YYYY-MM-DD HH24:MI')*/ AS FECHA_ALTA ,'$$p_usuario' , ID_CENTRO_COMPRA , ID_CAMPANA , MODELO , CALIDAD , COLOR , TALLA ,CANTIDAD_PENDIENTE FROM $$p_staging.ECDA_AXINF_STOCK_ALM_ECOMM WHERE ID_ARTICULO_COLOR_TALLA > 0;

CALL ADMIN.USP_TRUNCATE('$$p_etlstaging', 'UEZARA_AUX_SUSC_ARTIC');
DECLARE GLOBAL TEMPORARY TABLE SESSION.CATENT ( CATENTRY_ID BIGINT, MFPARTNUMBER VARCHAR(64), PARTNUMBER VARCHAR (64)) ON COMMIT PRESERVE ROWS not logged;
INSERT INTO SESSION.CATENT( SELECT CATENTRY_ID, MFPARTNUMBER, PARTNUMBER FROM $$p_uezara.CATENTRY WHERE CATENTTYPE_ID = 'ItemBean');
CREATE INDEX SESSION.CATENT_IDX ON SESSION.CATENT(CATENTRY_ID) COLLECT DETAILED STATISTICS;
DECLARE GLOBAL TEMPORARY TABLE SESSION.STORES400( STORE_ID INTEGER, COD_TIENDA_AS400 INTEGER) ON COMMIT PRESERVE ROWS not logged;
INSERT INTO SESSION.STORES400 SELECT A.STORE_ID, MIN(B.COD_TIENDA_AS400) FROM $$p_uezara.STORE A INNER JOIN $$p_uezara.XIMPUESTO_TIENDA_AS400 B ON REPLACE(A.DIRECTORY,'ZARA_','') = B.COUNTRYABBR GROUP BY A.STORE_ID;
INSERT INTO $$p_etlstaging.UEZARA_AUX_SUSC_ARTIC SELECT CAT.MFPARTNUMBER, CAT.PARTNUMBER, ST.COD_TIENDA_AS400, SA.ID_SUSCRIPCION_ARTICULO, SA.ID_ESTADO_SUSCRIPCION_ARTICULO, SA.COD_ENTRADA_CATALOGO, SA.COD_TIENDA, SA.EMAIL, SA.COD_IDIOMA, SA.FECHA_ALTA, SA.FECHA_MODIFICACION, SA.VERSION, SA.ID_TIPO_SUSCRIPCION_ARTICULO, SA.COD_CATEGORIA, SA.ID_TIPO_CANAL_SUSCRIPCION_ARTICULO AS ID_TIPO_CANAL_SUSCRIP_ARTIC , '$$p_origen' AS ORIGEN FROM $$p_cis.SUSCRIPCION_ARTICULO SA LEFT JOIN SESSION.CATENT CAT ON CAT.CATENTRY_ID = SA.COD_ENTRADA_CATALOGO LEFT JOIN SESSION.STORES400 ST ON ST.STORE_ID = SA.COD_TIENDA;
DROP TABLE SESSION.CATENT; DROP TABLE SESSION.STORES400;
